// import popo from '../Assets/img/logo1.jpg';
import '../Assets/css/MyHeader.css'
import { NavLink } from "react-router-dom";
// import { NavLink } from "react-router-dom";

function Details(){
    const [annonce, setAnnonce] = useState<any[]>([]);
  const fnct = async () => {
    let url =
      "https://webservicevoiture-production.up.railway.app/annonce/list";
    // let token = localStorage.getItem("Token");
    // console.log("tok :" + token);
    let response = await fetch(url, {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        // Authorization: "Bearer " + token,
      },
    }) as any ;
    response  = await response.json();
    setAnnonce(response.object);
    // if(response.status)
    console.log(response.object[0].photos[0].url)
    console.log(response.status);
  };

  useEffect(() => {
    fnct();
  }, []);
        return (
            <>
            <section className="py-5">
            <div className="container px-4 px-lg-5 my-5">
                <div className="row gx-4 gx-lg-5 align-items-center">
                    <div className="col-md-6"><img className="card-img-top mb-5 mb-md-0" src="https://dummyimage.com/600x700/dee2e6/6c757d.jpg" alt="..." /></div>
                    <div className="col-md-6">
                        <div className="small mb-1">SKU: BST-498</div>
                        <h1 className="display-5 fw-bolder">Shop item template</h1>
                        <div className="fs-5 mb-5">
                            <span className="text-decoration-line-through">$45.00</span>
                            <span>$40.00</span>
                        </div>
                        <p className="lead">Lorem ipsum dolor sit amet consectetur adipisicing elit. Praesentium at dolorem quidem modi. Nam sequi consequatur obcaecati excepturi alias magni, accusamus eius blanditiis delectus ipsam minima ea iste laborum vero?</p>
                        <div className="d-flex">
                            <input className="form-control text-center me-3" id="inputQuantity" type="num" value="1" style={{maxWidth: "3rem"}} />
                            <button className="btn btn-outline-dark flex-shrink-0" type="button">
                                <i className="bi-cart-fill me-1"></i>
                                <NavLink to={"/Chat"}>Acheter</NavLink>
                            </button>
                        </div>
                    </div>
                </div>
            </div>
        </section>
            </>
        );
    
                    };

export default Details;
